import React from 'react';
import { Formik, Form, Field, ErrorMessage } from "formik";
(
    function createPost() {
        return (
            <div class createPostPage>
                <Formik>
                    <Form>
                        <Field id="inputCreatePost" name ="title" placeholder="(Ex.jhon...)"/>
                    </Form>
                </Formik>
            </div>
        )
    }
)();

export default createPost
